import React from 'react';
import PropTypes from 'prop-types';

const  Header = (props ) =>{
    return (
        <nav className="site-header sticky-top py-1">
            <div className="container d-flex flex-column flex-md-row justify-content-between">
                <a className="py-2" href="#">
                    <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" strokeLinecap="round" stroke-linejoin="round" className="d-block mx-auto"><circle cx="12" cy="12" r="10"></circle><line x1="14.31" y1="8" x2="20.05" y2="17.94"></line><line x1="9.69" y1="8" x2="21.17" y2="8"></line><line x1="7.38" y1="12" x2="13.12" y2="2.06"></line><line x1="9.69" y1="16" x2="3.95" y2="6.06"></line><line x1="14.31" y1="16" x2="2.83" y2="16"></line><line x1="16.62" y1="12" x2="10.88" y2="21.94"></line></svg>
                </a>
                <a className="py-2 d-none d-md-inline-block" href="#">Tour</a>
                <a className="py-2 d-none d-md-inline-block" href="#">Product</a>
                <a className="py-2 d-none d-md-inline-block" href="#">Features</a>
                <a className="py-2 d-none d-md-inline-block" href="#">Enterprise</a>
                <a className="py-2 d-none d-md-inline-block" href="#">Support</a>
                <a className="py-2 d-none d-md-inline-block" href="#">Pricing</a>
                <a className="py-2 d-none d-md-inline-block" href="#">Cart</a>
            </div>
        </nav>
    )
}

Header.defaultProps={
    branding:PropTypes.string.isRequired
}

const headingStyle  =   {
    // color:'red',
    fontSize:'50px'
}

export default Header;
